# 3、无重复字符的最长子串

class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        longest = 0
        for i in range(len(s)):
            str_ = ''
            if i >= len(s) - longest:
                return longest
            for j in s[i:]:
                if j not in str_:
                    str_ += j
                else:
                    if len(str_) > longest:
                        longest = len(str_)
                        if longest == 95:
                            return longest
                    str_ = j
            if len(str_) > longest:
                longest = len(str_)
                if longest == 95:
                    return longest
        return longest


